import { Row, Col } from "react-bootstrap";
const Rules = () => {
  return (
    <Row>
      <Col>
        <div className="d-flex  flex-column my-3">
          <h4 className="d-flex">Rules</h4>
          <span className="d-flex">Ruleset not available.</span>
        </div>
      </Col>
      <Col></Col>
    </Row>
  );
};
export default Rules;
